Dredd (2012) R  |  95 min  |  Action, Sci-Fi  |  21 September 2012 (USA)

Mega City One is a vast, violent metropolis where felons rule the streets. The only law lies with cops called &quot;judges,&quot; who act as judge, jury and executioner, and Dredd (Karl Urban) is one of the city's most feared. One day, Dredd is partnered with Cassandra (Olivia Thirlby), a rookie with powerful psychic abilities. A report of a terrible crime sends Dredd and Cassandra to a dangerous area controlled by Ma-Ma (Lena Headey), a drug lord who will stop at nothing to protect her empire.

Stars: Karl Urban, Olivia Thirlby, Lena Headey


